s hombres a partir de piedras.</p>',29,'seleccionMultiple',8,1,0,0,'2022-03-02 05:23:45','2022-03-02 05:23:45'),(368,'Octava pregunta',NULL,'<h6><strong>A continuación, te presentamos las tramas de varias historias.</strong></h6><p><strong>1</strong>. La historia de cómo Chía, esposa de Bochica, se convirtió en la diosa de la Luna.</p><p><strong>2.</strong> La historia de la Madremonte, mujer guardiana de los bosques, que castiga a quien los daña.</p><p><strong><u>3.</u></strong><u> La historia de Aluna (diosa Tairona), la madre espiritual de todas las cosas, quien creó el mundo y todas las cosas.</u></p><p><strong>4.</strong> La historia de cómo Sintána y Nabobá dieron origen a los primeros hombres a partir de piedras.</p>',29,'seleccionMultiple',8,1,0,0,'2022-03-02 05:23:45','2022-03-02 05:23:45'),(369,'Novena pregunta',NULL,'<h6><strong>A continuación, te presentamos las tramas de varias historias.</strong></h6><p><strong>1</strong>. La historia de cómo Chía, esposa de Bochica, se convirtió en la diosa de la Luna.</p><p><strong>2.</strong> La historia de la Madremonte, mujer guardiana de los bosques, que castiga a quien los daña.</p><p><strong>3.</strong> La historia de Aluna (diosa Tairona), la madre espiritual de todas las cosas, quien creó el mundo y todas las cosas.</p><p><strong><u>4.</u></strong><u> La historia de cómo Sintána y Nabobá dieron origen a los primeros hombres a partir de piedras.</u></p>',29,'seleccionMultiple',8,1,0,0,'2022-03-02 05:23:46','2022-03-02 05:23:46'),(370,'Décima pregunta','fotografias/1644457714.jpg','<h6><strong>La imagen muestra a pandora, una mujer infinitamente hermosa creada por los dioses para castigar a los seres humanos, que vivían sin ningún mal. A ella se le dio el don de la belleza, pero también el de la curiosidad. Zeus le otorgó como obsequio una caja [en otros mitos es una ánfora o botella] y le hizo prometer que nunca la abriría, sin embargo, a pesar de que ella llegó al punto de enterrar la caja para no caer en la tentación, no se pudo resistir y a la final la abrió. De allí brotaron todos los males del mundo: el hambre, el sufrimiento, las enfermedades, etc. Quedando en el fondo únicamente la esperanza. Así es como los griegos explican el origen de todos los males</strong></h6>',29,'seleccionMultiple',8,1,0,0,'2022-03-02 05:23:46','2022-03-02 05:23:46'),(371,'Undécima pregunta','fotografias/1644458251.jpg','<p>Juana de Arco fue una joven campesina que es considerada una heroína de Francia por su papel durante la fase final de la Guerra de los Cien Años. Juana afirmó haber tenido visiones del Arcángel Miguel, de Santa Margarita y de Catalina de Alejandría, quienes le dieron instrucciones para que ayudara a Carlos&nbsp;VII y liberara a Francia de la dominación inglesa en el período final de la Guerra de los Cien Años.</p><p>En la historia de su vida se entremezcla realidad y ficción, ya que si bien fue un personaje histórico real, se la consideró como una mujer sobrehumana, con capacidades santas y se la consideraba elegida por Dios.</p><p></p><p>Su historia se aproxima más a:</p><p></p><p></p>',29,'seleccionMultiple',8,1,0,0,'2022-03-02 05:23:46','2022-03-02 05:23:46'),(372,'Duodécima pregunta','fotografias/1644458666.jpg','<p>Este es Cronos y le ha cortado<br>Las pelotas al Dios Urano<br>Caen al agua, hacen espuma<br>Y de ahí nace esta hermosura</p><p>Diosa del amor y la belleza, tiene<br>Casi enamorada a toda Grecia, ella es<br>(A-a-fro-di-ta)<br>(A-a-fro-di-ta-ta)</p><p>Viaja con su carro de palomas siempre<br>Con su corte de bebé en bolas, ella es<br>(A-a-fro-di-ta)<br>(A-a-fro-di-ta-ta)</p><h6><strong>El primer fragmento de la canción \"Afrodita\" de Pascu y Rodri es:</strong></h6>',29,'seleccionMultiple',8,1,0,0,'2022-03-02 05:23:46','2022-03-02 05:23:46'),(373,'Primera Pregunta',NULL,'<h6><strong>Falacia que usa la voz de una persona famosa o experta, sólo por ser reconocida, pero que tal vez no tenga conocimientos del tema</strong></h6>',30,'seleccionMultiple',5,1,1,0