s castiguemos y rebajemos las penas de la cárcel, y dejemos que salgan libres por ahí, que hagan lo que quieran.</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:10','2022-03-07 18:07:31'),(437,'Novena Pregunta',NULL,'<h6><strong><u>-Todas las aves tienen alas, el murciélago tiene alas, por lo tanto, es un ave</u></strong></h6>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:10','2022-03-07 18:09:25'),(438,'Décima pregunta',NULL,'<h6><strong>-Me acabo de unir a una nueva religión que dicta que el único dios verdadero es el dios lagarto.</strong></h6><p><strong>-¿Cómo lo sabes? ¿qué pruebas tienes?</strong></p><p><strong><u>- El mismo libro es la prueba, fue escrito por el dios lagarto</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:10','2022-03-07 18:11:59'),(439,'Undécima pregunta',NULL,'<h6><strong><u>Siempre durante las épocas de calor se ve a la gente comiendo helado, eso significa que comer helado atrae el calor</u></strong></h6>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:10','2022-03-07 18:14:23'),(440,'Duodécima Pregunta',NULL,'<h6><strong><u>Yo no sé, pero si no estás a favor de la pena de muerte para los ladrones entonces estás a favor del robo</u></strong></h6>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:16:15'),(441,'Decimotercera pregunta',NULL,'<h6><strong>- La tierra es plana, no redonda, mira nada más el paisaje ¿te parece que el mundo es curvo?</strong></h6><p><strong>- Pero las fotos desde el espacio muestran a la tierra redonda</strong></p><p><strong>- ¿Tú has ido al espacio para verlo? No me digas que crees en los montajes de la NASA</strong></p><p><strong>- No he ido al espacio, pero te digo que es redonda.</strong></p><p><strong><u>-Entonces como no puedes traerme una foto de la tierra desde el espacio, no puedes probar que sea redonda, por lo tanto, es plana.</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:18:21'),(442,'Decimocuarta pregunta',NULL,'<h6><strong><u>La experta en Informática Lasly Gomez recomienda el uso de pasta dental como removedor de granos</u></strong></h6>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:20:43'),(443,'Decimoquinta pregunta',NULL,'<h6><strong><u>O construimos una carretera por el páramo o Herrera no va a progresar</u></strong></h6>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:22:27'),(444,'Decimosexta pregunta',NULL,'<h6><strong><u>La reconocida actriz Scarllet Johansen recomienda la crema Colgate para el cuidado de la caries</u></strong></h6>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:23:49'),(445,'Decimoséptima pregunta',NULL,'<h6><strong>-Mi abuelo dice que en el monte de atrás de la quebrada sale una bruja por las noches.</strong></h6><p><strong>-No me creo eso</strong></p><p><strong>-Has ido al monte de detrás de la quebrada a ver si es mentira?</strong></p><p><strong>-No, no he ido</strong></p><p><strong><u>- ¿Ves? Entonces es verdad porque no has ido a comprobar que sea falso</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:25:17'),(446,'Decimoctava pregunta',NULL,'<p><strong><u>El gallo canta antes del&nbsp; amanecer, por lo tanto el canto del gallo causa que salga el Sol</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:11','2022-03-07 18:26:45'),(447,'Decimonovena pregunta',NULL,'<h6><strong>Queremos fomentar el hábito saludable de la bicicleta para ir al trabajo</strong></h6><p><strong><u>Ustedes lo que quieren es que la gente sufra accidentes y los atropellen ya que es un medio de transporte poco seguro</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:12','2022-03-07 18:28:12'),(448,'vigésima pregunta',NULL,'<p><strong>No considero apropiado que los adolescentes vayan solos de vacaciones.<br></strong></p><p><strong><u>Usted lo que quiere es obligarlos a estar encerrados en casa y que no tengan vida social</u></strong></p>',33,'seleccionMultiple',8,1,1,0,'2022-03-07 06:33:12','2022-03-07 18:29:35'),(449,'Primera pregunta',NULL,'<p>Un mito antropogénico es aquel que:</p>',34,'seleccionMultiple',5,1,1,0,'2022-03-09 20:44:26','2022-03-09 22:27:59'),(450,'Segunda pregunta',NULL,'<h6><strong>Un mito teogónico es aquel que</strong></h6>',34,'seleccionMultiple',5,1,1,0,'2022-03-09 20:44:26','2022-03-09 22:28:56'),(451,'Tercera pregunta',NULL,'<h6><strong>Un mito cosmogónico es aquel que</strong></h6>',34,'seleccionMultiple',5,1,1,0,'2022-03-09 20:44:26','2022-03-09 22:29:56'),(452,'Cuarta pregunta',NULL,'<p>La llorona es un alma en pena que como su nombre indica, vaga llorando en busca de sus hijos, a quienes ella ahogó estando en vida, espanta a las madres que maltratan o no cuidan de sus hijos.</p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:26','2022-03-09 22:31:44'),(453,'Quinta pregunta',NULL,'<h6></h6><p>Bachué, según el pueblo Muisca, fue la primera mujer, <strong>la cual dio origen a toda la humanidad</strong>. Esta historia es un:</p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:26','2022-03-09 22:33:15'),(454,'Sexta pregunta',NULL,'<h6><strong>A continuación, te presentamos las tramas de varias historias.</strong></h6><p><strong><u>1</u></strong><u>. La historia de cómo Chía, esposa de Bochica, se convirtió en la diosa de la Luna.</u></p><p><strong>2.</strong> La historia de la Madremonte, mujer guardiana de los bosques, que castiga a quien los daña.</p><p><strong>3.</strong> La historia de Aluna (diosa Tairona), la madre espiritual de todas las cosas, quien creó el mundo y todas las cosas.</p><p><strong>4.</strong> La historia de cómo Sintána y Nabobá dieron origen a los primeros hombres a partir de piedras.</p><p></p><p></p><p>La historia uno es:</p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:26','2022-03-09 22:34:47'),(455,'Séptima pregunta',NULL,'<h6><strong>A continuación, te presentamos las tramas de varias historias.</strong></h6><p><strong>1</strong>. La historia de cómo Chía, esposa de Bochica, se convirtió en la diosa de la Luna.</p><p><strong><u>2.</u></strong><u> La historia de la Madremonte, mujer guardiana de los bosques, que castiga a quien los daña.</u></p><p><strong>3.</strong> La historia de Aluna (diosa Tairona), la madre espiritual de todas las cosas, quien creó el mundo y todas las cosas.</p><p><strong>4.</strong> La historia de cómo Sintána y Nabobá dieron origen a los primeros hombres a partir de piedras.</p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:27','2022-03-09 22:36:07'),(456,'Octava pregunta',NULL,'<h6><strong>A continuación, te presentamos las tramas de varias historias.</strong></h6><p><strong>1</strong>. La historia de cómo Chía, esposa de Bochica, se convirtió en la diosa de la Luna.</p><p><strong>2.</strong> La historia de la Madremonte, mujer guardiana de los bosques, que castiga a quien los daña.</p><p><strong><u>3.</u></strong><u> La historia de Aluna (diosa Tairona), la madre espiritual de todas las cosas, quien creó el mundo y todas las cosas.</u></p><p><strong>4.</strong> La historia de cómo Sintána y Nabobá dieron origen a los primeros hombres a partir de piedras.</p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:27','2022-03-09 22:37:22'),(457,'Novena pregunta',NULL,'<h6><strong>A continuación, te presentamos las tramas de varias historias.</strong></h6><p><strong>1</strong>. La historia de cómo Chía, esposa de Bochica, se convirtió en la diosa de la Luna.</p><p><strong>2.</strong> La historia de la Madremonte, mujer guardiana de los bosques, que castiga a quien los daña.</p><p><strong>3.</strong> La historia de Aluna (diosa Tairona), la madre espiritual de todas las cosas, quien creó el mundo y todas las cosas.</p><p><strong><u>4.</u></strong><u> La historia de cómo Sintána y Nabobá dieron origen a los primeros hombres a partir de piedras.</u></p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:27','2022-03-09 22:38:28'),(458,'Décima pregunta','fotografias/1644457714.jpg','<h6><strong>La imagen muestra a pandora, una mujer infinitamente hermosa creada por los dioses para castigar a los seres humanos, que vivían sin ningún mal. A ella se le dio el don de la belleza, pero también el de la curiosidad. Zeus le otorgó como obsequio una caja [en otros mitos es una ánfora o botella] y le hizo prometer que nunca la abriría, sin embargo, a pesar de que ella llegó al punto de enterrar la caja para no caer en la tentación, no se pudo resistir y a la final la abrió. De allí brotaron todos los males del mundo: el hambre, el sufrimiento, las enfermedades, etc. Quedando en el fondo únicamente la esperanza. Así es como los griegos explican el origen de todos los males</strong></h6>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:27','2022-03-09 22:39:56'),(459,'Undécima pregunta','fotografias/1644458251.jpg','<p>Juana de Arco fue una joven campesina que es considerada una heroína de Francia por su papel durante la fase final de la Guerra de los Cien Años. Juana afirmó haber tenido visiones del Arcángel Miguel, de Santa Margarita y de Catalina de Alejandría, quienes le dieron instrucciones para que ayudara a Carlos&nbsp;VII y liberara a Francia de la dominación inglesa en el período final de la Guerra de los Cien Años.</p><p>En la historia de su vida se entremezcla realidad y ficción, ya que si bien fue un personaje histórico real, se la consideró como una mujer sobrehumana, con capacidades santas y se la consideraba elegida por Dios.</p><p></p><p>Su historia se aproxima más a:</p><p></p><p></p>',34,'seleccionMultiple',8,1,1,0,'2022-03-09 20:44:27','2022-03-09 22:41:21'),(460,'Duodécima pregunta','fotografias/1644458666.jpg','<p>Este es Cronos y le ha cortado<br>Las pelotas al Dios Urano<br>Caen al agua, hacen espuma<br>Y de ahí nace esta hermosura</p><p>Diosa del amor y la belleza, tiene<br>Casi enamorada a toda Grecia, ella es<br>(A-a-fro-di-ta)<br>(A-a-fro-di-ta-ta)</p><p>Viaja con su carro de palomas siempre<br>Con su corte de bebé en bolas, ella es<br>(A-a-fro-di-ta)<br>(A-a-fro-di-ta-ta)</p><h6><strong>El primer fragmento de la canción \"Afrodita\" de Pascu y Rodri es:</strong></h6>',34,'seleccionMultiple',8,1,1,1,'2022-03-09 20:44:27','2022-03-09 22:42:50'),(465,'Primera Pregunta',NULL,'<h6>Mariana ha comprado un mueble en Homecenter, el mueble venía con una guía que tenía el paso a paso para armarlo.</h6><h6>Este tipo de texto es:</h6>',35,'seleccionMultiple',7,1,1,0,'2022-05-01 20:53:31','2022-05-03 03:09:44'),(466,'Segunda Pregunta',NULL,'<p><strong>Elizabeth ha empezado a discutir con Diego acerca de lo perjudicial que es el consumo de azúcar, pero él no está de acuerdo y dice que el azúcar es necesario para el cuerpo, el profesor les propone que elabore cada uno un ensayo en el que presenten y defiendan su punto de vista.</strong></p><p><strong>Estos ensayos son textos de tipo:</strong></p>',35,'seleccionMultiple',7,1,1,0,'2022-05-01 20:53:31','2022-05-03 03:11:44'),(467,'Tercera Pregunta',NULL,'<p>A Mariano lo invitaron de su partido político a escuchar hablar al candidato, el candidato va a presentar su discurso exponiendo las razones por las cuales deberían escogerlo como representante de la comunidad.</p><p>El discurso que presentará es un texto de tipo:</p>',35,'seleccionMultiple',7,1,1,0,'2022-05-01 20:53:31','2022-05-03 03:13:46'),(468,'Cuarta Pregunta','fotografias/1643644156.jpg','<p>Esta imagen corresponde a un texto de qué tipo:</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:31','2022-05-03 03:15:10'),(469,'Quinta Pregunta',NULL,'<p>Enrique debe hacer un ensayo para argumentar lo mala que es la carne procesada y sus efectos cancerígenos, sin embargo enrique no tiene idea de lo que es un efecto cancerígeno, así que buscará textos que le digan qué es un efecto cancerígeno y cómo se produce.</p><p>Los textos que buscará son de tipo</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:32','2022-05-03 03:17:08'),(470,'Sexta Pregunta',NULL,'<p>Uno de los siguientes textos no es un texto argumentativo.</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:32','2022-05-03 03:19:24'),(471,'Séptima Pregunta',NULL,'<p>El profesor le pide a sus estudiantes que saquen el libro de estudio, en él está la definición del tema del día [La novela], ahí está explicado qué es la novela, cómo surgió y menciona algunos ejemplos de novela. Podemos decir que ese libro de estudio es un libro de tipo:</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:41','2022-05-03 03:21:08'),(472,'Octava Pregunta',NULL,'<h6><strong>Género literario enfocado en contar historias, no necesita ser interpretado en público.</strong></h6>',35,'seleccionMultiple',5,1,1,0,'2022-05-01 20:53:41','2022-05-03 03:22:48'),(473,'Novena Pregunta',NULL,'<h6><strong>Género literario que requiere de actores para ser representado.</strong></h6>',35,'seleccionMultiple',5,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:23:40'),(474,'Décima Pregunta',NULL,'<p>Hombres necios que acusáis<br>a la mujer sin razón<br>sin ver que sois la ocasión<br>de lo mismo que culpáis:</p><p>si con ansia sin igual<br>solicitáis su desdén<br>¿por qué queréis que obren bien<br>si las incitáis al mal?</p><p></p><p>Esta obra es del género</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:24:52'),(475,'Undécima Pregunta',NULL,'<h6><strong>OTELO:</strong> ¿Lo dices en serio?</h6><h6><br><strong>YAGO:</strong> Engañó a su padre al casarse con vos;<br>y, cuando parecía temblar y temer<br>vuestro semblante, es cuando más os quería.</h6><h6><br><strong>OTELO: </strong>Es verdad.</h6><h6><br><strong>YAGO: </strong>Pues, eso. Si tan joven ya sabía<br>sacar esa apariencia, dejando a su padre<br>tan ciego que creía que era magia...<br>He hecho muy mal. Os pido humildemente<br>perdón por apreciaros tanto.</h6><h6><br><strong>OTELO: </strong>Siempre te estaré agradecido.<br></h6><h6><strong>YAGO: </strong>Veo que esto os ha desconcertado.</h6><h6><br><strong>OTELO: </strong>Nada de eso, nada de eso.</h6><p></p><p></p><p>El fragmento anterior es del género</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:26:09'),(476,'Duodécima Pregunta',NULL,'<h6>—¿Dónde están vuestros padres?</h6><p>Los niños comenzaron a sonreír. Uno de los pequeños había cogido uno de los fusiles</p><p>de los patrulleros.</p><p>—Deja eso, es peligroso andar con armas... —dijo uno de los agentes al niño, que parecía divertido</p><p>apuntándole.</p><p>—Basta de bromas —dijo el otro agente, algo nervioso. Se miraron entre sí.</p><p>Los niños reían.</p><p>Los agentes comprendieron. Pudieron intuir vagamente lo que en realidad había sucedido en aquel malecón. Pero fue tarde.</p><p>El niño le disparó al corazón. Cuando los patrulleros quedaron sin vida, los niños gritaron ensordecedoramente</p><p></p><p>El anterior fragmento es de</p><h2>El juego de los niños</h2><p>de <strong>Juan José Plans</strong></p><p></p><p>Es del género: <br></p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:27:12'),(477,'Decimotercera Pregunta',NULL,'<h6>Nada tienen de especial<br>Dos mujeres que se dan la mano<br>El matiz viene después<br>Cuando lo hacen por debajo del mantel</h6><p>Luego a solas sin nada que perder<br>Tras las manos va el resto de la piel<br>Un amor por ocultar<br>Aunque en cueros no hay donde esconderlo<br>Lo disfrazan de amistad<br>Cuando sale a pasear por la ciudad</p><p></p><p>El fragmento anterior es del género</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:28:37'),(478,'Decimocuarta Pregunta',NULL,'<p>–Yo soy el Recitador de la Ley –replicó la figura gris–. Aquí vienen todos los nuevos para aprender la Ley. Me siento en la oscuridad y recito la Ley.</p><p>–Así es –añadió una de las bestias desde la puerta. –Terrible es el castigo para quienes quebrantan la Ley. No hay escapatoria.</p><p>–No hay escapatoria –repitió la multitud de Salvajes, lanzándose miradas furtivas los unos a los otros.</p><p>–No hay escapatoria –repitió el Hombre Mono–. No la hay. ¡Mira! Una vez hice algo malo, algo sin importancia. Dejé de hablar y empecé a chapurrear. Nadie me entendía. Y me quemaron, me marcaron la mano con un hierro candente. ¡Él es grande; Él es bueno!</p><p>–No hay escapatoria –proclamó la criatura del rincón.</p><p>–No hay escapatoria –repitieron las bestias, mirándose de reojo.</p><p>–Porque todos deseamos el mal –continuó el recitador de la Ley–. No sabemos lo que tú deseas. Pero lo sabremos.</p><p></p><p>El anterior fragmento pertenece a \"La isla del doctor Moreau\"</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:29:53'),(479,'Segunda pregunta',NULL,'<p>Parte del ensayo en la que se exponen las razones o argumentos que intentan apoyar la tesis.</p>',35,'seleccionMultiple',5,0,0,0,'2022-05-01 20:53:42','2022-05-02 19:02:04'),(480,'Decimoquinta Pregunta',NULL,'<p></p><p>La primera razón por la que desaconsejamos el uso de conservantes artificiales es debido a que se ha descubierto que un consumo excesivo de estas sustancias es un factor de riesgo cuando se habla de adquirir cáncer gástrico.</p><p>Así mismo otro argumento en contra del uso de conservantes es porque se ha encontrado una relación en su uso y los altos índices de anemia.</p><p></p><p>Este fragmento corresponde a:</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:32:00'),(481,'Decimosexta Pregunta',NULL,'<p>En el presente texto se pretende hablar de la importancia de la lúdica en la educación. A través de los diferentes autores que se analizarán se pretende demostrar que el juego y la competencia constituyen un factor fundamental en el desarrollo y la motivación de los estudiantes.</p><p></p><p>Este fragmento corresponde a:</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:34:08'),(482,'Decimoséptima Pregunta',NULL,'<p>En el desarrollo del presente trabajo hablaremos del <strong>consumo del alcohol</strong>, pero no de sus efectos en la salud, sino que se intentará demostrar que <u>es la principal causa de accidentes automovilísticos; </u>para lo cual se analizarán <s>los datos de los accidentes de los últimos 10 años en Colombia.</s></p><p>Identifique cuál es la tesis y cuál es el tema.</p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:42','2022-05-03 03:36:11'),(483,'Decimoctava Pregunta',NULL,'<p>Se ha hablado mucho de las diferentes dietas para bajar peso, <s>cada día en tik tok aparecen más influence<u>rs</u></s> que sin ser nutriólogas hacen diferentes recomendaciones en la alimentación, hoy hablaremos de <strong>la dieta Keto</strong> y por qué está <u>es un riesgo para la salud</u></p>',35,'seleccionMultiple',8,1,1,0,'2022-05-01 20:53:44','2022-05-03 03:37:53'),(484,'Decimonovena Pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar la venta de mascotas</p>',35,'seleccionMultiple',6,1,1,0,'2022-05-01 20:53:44','2022-05-03 03:39:30'),(485,'Vigésima Pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar el uso de criptomonedas.</p>',35,'seleccionMultiple',6,1,1,0,'2022-05-01 20:53:44','2022-05-03 03:41:06'),(486,'Primera Pregunta',NULL,'<h6>Mariana ha comprado un mueble en Homecenter, el mueble venía con una guía que tenía el paso a paso para armarlo.</h6><h6>Este tipo de texto es:</h6>',36,'seleccionMultiple',7,1,1,0,'2022-05-02 19:12:51','2022-05-02 23:35:21'),(487,'Segunda Pregunta',NULL,'<p><strong>Elizabeth ha empezado a discutir con Diego acerca de lo perjudicial que es el consumo de azúcar, pero él no está de acuerdo y dice que el azúcar es necesario para el cuerpo, el profesor les propone que elabore cada uno un ensayo en el que presenten y defiendan su punto de vista.</strong></p><p><strong>Estos ensayos son textos de tipo:</strong></p>',36,'seleccionMultiple',7,1,1,0,'2022-05-02 19:12:51','2022-05-02 23:38:29'),(488,'Tercera Pregunta',NULL,'<p>A Mariano lo invitaron de su partido político a escuchar hablar al candidato, el candidato va a presentar su discurso exponiendo l