2-05-02 19:12:53','2022-05-03 00:00:28'),(501,'Decimosexta Pregunta',NULL,'<p>En el presente texto se pretende hablar de la importancia de la lúdica en la educación. A través de los diferentes autores que se analizarán se pretende demostrar que el juego y la competencia constituyen un factor fundamental en el desarrollo y la motivación de los estudiantes.</p><p></p><p>Este fragmento corresponde a:</p>',36,'seleccionMultiple',8,1,1,0,'2022-05-02 19:12:53','2022-05-03 00:01:47'),(502,'Decimoséptima Pregunta',NULL,'<p>En el desarrollo del presente trabajo hablaremos del <strong>consumo del alcohol</strong>, pero no de sus efectos en la salud, sino que se intentará demostrar que <u>es la principal causa de accidentes automovilísticos; </u>para lo cual se analizarán <s>los datos de los accidentes de los últimos 10 años en Colombia.</s></p><p>Identifique cuál es la tesis y cuál es el tema.</p>',36,'seleccionMultiple',8,1,1,0,'2022-05-02 19:12:53','2022-05-03 00:03:28'),(503,'Decimoctava Pregunta',NULL,'<p>Se ha hablado mucho de las diferentes dietas para bajar peso, <s>cada día en tik tok aparecen más influence<u>rs</u></s> que sin ser nutriólogas hacen diferentes recomendaciones en la alimentación, hoy hablaremos de <strong>la dieta Keto</strong> y por qué está <u>es un riesgo para la salud</u></p>',36,'seleccionMultiple',8,1,1,0,'2022-05-02 19:12:53','2022-05-03 00:05:05'),(504,'Decimonovena Pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar la venta de mascotas</p>',36,'seleccionMultiple',6,1,1,0,'2022-05-02 19:12:53','2022-05-03 00:06:34'),(505,'Vigésima Pregunta',NULL,'<p>Uno de los siguientes argumentos sirve para apoyar el uso de criptomonedas.</p>',36,'seleccionMultiple',6,1,1,0,'2022-05-02 19:12:53','2022-05-03 00:08:04'),(506,'Primera Pregunta',NULL,'<h6>Mariana ha comprado un mueble en Homecenter, el mueble venía con una guía que tenía el paso a paso para armarlo.</h6><h6>Este tipo de texto es:</h6>',37,'seleccionMultiple',7,1,1,0,'2022-05-02