05-02 19:18:31','2022-05-03 01:40:22'),(513,'Octava Pregunta',NULL,'<h6><strong>Género literario enfocado en contar historias, no necesita ser interpretado en público.</strong></h6>',37,'seleccionMultiple',5,1,1,0,'2022-05-02 19:18:31','2022-05-03 01:42:02'),(514,'Novena Pregunta',NULL,'<h6><strong>Género literario que requiere de actores para ser representado.</strong></h6>',37,'seleccionMultiple',5,1,1,0,'2022-05-02 19:18:31','2022-05-03 01:43:31'),(515,'Décima Pregunta',NULL,'<p>Hombres necios que acusáis<br>a la mujer sin razón<br>sin ver que sois la ocasión<br>de lo mismo que culpáis:</p><p>si con ansia sin igual<br>solicitáis su desdén<br>¿por qué queréis que obren bien<br>si las incitáis al mal?</p><p></p><p>Esta obra es del género</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:31','2022-05-03 01:45:07'),(516,'Undécima Pregunta',NULL,'<h6><strong>OTELO:</strong> ¿Lo dices en serio?</h6><h6><br><strong>YAGO:</strong> Engañó a su padre al casarse con vos;<br>y, cuando parecía temblar y temer<br>vuestro semblante, es cuando más os quería.</h6><h6><br><strong>OTELO: </strong>Es verdad.</h6><h6><br><strong>YAGO: </strong>Pues, eso. Si tan joven ya sabía<br>sacar esa apariencia, dejando a su padre<br>tan ciego que creía que era magia...<br>He hecho muy mal. Os pido humildemente<br>perdón por apreciaros tanto.</h6><h6><br><strong>OTELO: </strong>Siempre te estaré agradecido.<br></h6><h6><strong>YAGO: </strong>Veo que esto os ha desconcertado.</h6><h6><br><strong>OTELO: </strong>Nada de eso, nada de eso.</h6><p></p><p></p><p>El fragmento anterior es del género</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:31','2022-05-03 01:53:49'),(517,'Duodécima Pregunta',NULL,'<h6>—¿Dónde están vuestros padres?</h6><p>Los niños comenzaron a sonreír. Uno de los pequeños había cogido uno de los fusiles</p><p>de los patrulleros.</p><p>—Deja eso, es peligroso andar con armas... —dijo uno de los agentes al niño, que parecía divertido</p><p>apuntándole.</p><p>—Basta de bromas —dijo el otro agente, algo nervioso. Se miraron entre sí.</p><p>Los niños reían.</p><p>Los agentes comprendieron. Pudieron intuir vagamente lo que en realidad había sucedido en aquel malecón. Pero fue tarde.</p><p>El niño le disparó al corazón. Cuando los patrulleros quedaron sin vida, los niños gritaron ensordecedoramente</p><p></p><p>El anterior fragmento es de</p><h2>El juego de los niños</h2><p>de <strong>Juan José Plans</strong></p><p></p><p>Es del género: <br></p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:31','2022-05-03 01:55:56'),(518,'Decimotercera Pregunta',NULL,'<h6>Nada tienen de especial<br>Dos mujeres que se dan la mano<br>El matiz viene después<br>Cuando lo hacen por debajo del mantel</h6><p>Luego a solas sin nada que perder<br>Tras las manos va el resto de la piel<br>Un amor por ocultar<br>Aunque en cueros no hay donde esconderlo<br>Lo disfrazan de amistad<br>Cuando sale a pasear por la ciudad</p><p></p><p>El fragmento anterior es del género</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:31','2022-05-03 01:58:01'),(519,'Decimocuarta Pregunta',NULL,'<p>–Yo soy el Recitador de la Ley –replicó la figura gris–. Aquí vienen todos los nuevos para aprender la Ley. Me siento en la oscuridad y recito la Ley.</p><p>–Así es –añadió una de las bestias desde la puerta. –Terrible es el castigo para quienes quebrantan la Ley. No hay escapatoria.</p><p>–No hay escapatoria –repitió la multitud de Salvajes, lanzándose miradas furtivas los unos a los otros.</p><p>–No hay escapatoria –repitió el Hombre Mono–. No la hay. ¡Mira! Una vez hice algo malo, algo sin importancia. Dejé de hablar y empecé a chapurrear. Nadie me entendía. Y me quemaron, me marcaron la mano con un hierro candente. ¡Él es grande; Él es bueno!</p><p>–No hay escapatoria –proclamó la criatura del rincón.</p><p>–No hay escapatoria –repitieron las bestias, mirándose de reojo.</p><p>–Porque todos deseamos el mal –continuó el recitador de la Ley–. No sabemos lo que tú deseas. Pero lo sabremos.</p><p></p><p>El anterior fragmento pertenece a \"La isla del doctor Moreau\"</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:31','2022-05-03 02:00:06'),(520,'Decimoquinta Pregunta',NULL,'<p></p><p>La primera razón por la que desaconsejamos el uso de conservantes artificiales es debido a que se ha descubierto que un consumo excesivo de estas sustancias es un factor de riesgo cuando se habla de adquirir cáncer gástrico.</p><p>Así mismo otro argumento en contra del uso de conservantes es porque se ha encontrado una relación en su uso y los altos índices de anemia.</p><p></p><p>Este fragmento corresponde a:</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:32','2022-05-03 02:01:36'),(521,'Decimosexta Pregunta',NULL,'<p>En el presente texto se pretende hablar de la importancia de la lúdica en la educación. A través de los diferentes autores que se analizarán se pretende demostrar que el juego y la competencia constituyen un factor fundamental en el desarrollo y la motivación de los estudiantes.</p><p></p><p>Este fragmento corresponde a:</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:32','2022-05-03 02:03:00'),(522,'Decimoséptima Pregunta',NULL,'<p>En el desarrollo del presente trabajo hablaremos del <strong>consumo del alcohol</strong>, pero no de sus efectos en la salud, sino que se intentará demostrar que <u>es la principal causa de accidentes automovilísticos; </u>para lo cual se analizarán <s>los datos de los accidentes de los últimos 10 años en Colombia.</s></p><p>Identifique cuál es la tesis y cuál es el tema.</p>',37,'seleccionMultiple',8,1,1,0,'2022-05-02 19:18:32','2022-05-03 02:05:14'),(523,'Decimoctava Pregunta',NULL,'<p>Se ha hablado mucho de las diferentes dietas para bajar peso, <s>cada día en tik tok aparecen más influence<u>rs</u></s> que sin ser nutriólogas hacen diferentes recomendaciones en la alimentación, hoy hablaremos de <strong>la dieta Keto</strong> y por qué está <u>es un riesgo para la salud</u></p>',37,'seleccionMultip