ombres, 15 o más tragos a la semana.</p></li></ul></li></ul><p>La mayoría de las personas que consumen alcohol en exceso no son alcohólicas ni tienen dependencia al alcohol.</p><p></p><h6><strong>Uno de los siguientes temas no fue tratado en el texto</strong></h6>',40,'seleccionMultiple',12,1,1,0,'2022-05-23 22:26:09','2022-05-23 23:48:10'),(577,'Decimoquinta pregunta',NULL,'<h6></h6><h1><strong>El consumo de alcohol y su salud</strong></h1><p>Beber alcohol en exceso puede ser perjudicial para su salud. En los Estados Unidos, el consumo excesivo de alcohol ocasionó aproximadamente 140 000 muertes y representó 3.6 millones de años de vida potencial perdidos (AVPP) anualmente desde el 2015 al 2019, y acortó en un promedio de 26 años la vida de los que fallecieron.&nbsp;Adicionalmente, el consumo de alcohol en exceso fue responsable de 1 de cada 10 muertes de adultos en edad laboral de entre 20 y 64 años. El costo económico del consumo excesivo de alcohol en el 2010 se estimó en USD $249 000 millones o USD $2.05 dólares por bebida.</p><p></p><h4><strong>¿Qué es beber en exceso?</strong></h4><p>Beber en exceso incluye los atracones de alcohol, beber demasiado y cualquier consumo de alcohol por parte de mujeres embarazadas o personas menores de 21 años.</p><ul><li><p>El atracón de alcohol, la forma más común de consumo de alcohol en exceso, se define como beber lo siguiente:</p><ul><li><p>En las mujeres, 4 o más tragos en una misma ocasión.</p></li><li><p>En los hombres, 5 o más tragos en una misma ocasión.</p></li></ul></li><li><p>Beber demasiado alcohol se define como consumir lo siguiente:</p><ul><li><p>En las mujeres, 8 o más tragos a la semana.</p></li><li><p>En los hombres, 15 o más tragos a la semana.</p></li></ul></li></ul><p>La mayoría de las personas que consumen alcohol en exceso no son alcohólicas ni tienen dependencia al alcohol.</p><p></p><h6><strong>El orden de la información tratada en el primer párrafo del texto sería</strong></h6>',40,'seleccionMultiple',12,1,1,0,'2022-05-23 22:26:09','2022-05-23 23:51:21'),(578,'Decimosexta pregunta',NULL,'<p></p><p>Un estudio realizado en junio pasado por el Centro de Investigación de Salud y Violencia (Cisalva) de la Universidad del Valle, estableció que solo el 1,7 por ciento de los motociclistas incluidos en un muestreo por las principales calles de la ciudad llevaban el casco protector.</p><p>El alcalde Mauricio Guzmán calcula en cien mil el número de motocicletas que circulan por la ciudad, pero oficialmente, hasta diciembre pasado, estaban matriculadas en Cali 68.492. Sin embargo, como lo explican los investigadores, el número es mucho más alto si se tiene en cuenta que gran parte de estos son registrados y proceden de otros municipios vecinos.</p><p>La Alcaldía ha expresado su seguridad de que con el uso del casco se reducirán considerablemente las cifras de heridos y muertos como consecuencia de accidentes de tránsito. El año (1994) pasado fueron 646 muertos, de los cuales 215,2 correspondieron a motociclistas o sus acompañantes.</p><p>Pero uno de los puntos que más preocupación causa es el de los costos sociales. Muerto o herido el individuo, se comprometen recursos económicos de la familia, su estabilidad emocional y laboral (hay que cuidar al enfermo), pérdida de empleo, etcétera.</p><p>El 40 por ciento de las muertes ocurridas en el período 1975-82 correspondieron a empleados y comerciantes en las edades comprendidas entre 20 y 40 años. Esto trae consigo grandes consecuencias económicas, ya que las personas afectadas se encuentran en el grupo de edad que se caracteriza por ser la población económicamente productiva, incrementando los años potenciales de vida perdidos .</p><p>Según el estudio de Cisalva, la gravedad de las lesiones producidas, especialmente el trauma craneoencefálico, representan el 30 por ciento de las intervenciones quirúrgicas realizadas.</p><p>Finalmente cita un estudio realizado en Cali en 1994, donde se encontró que en ninguno de los casos ni controles estudiados el afectado usaba casco y el trauma craneoencefálico se presentó en el 80 por ciento de los casos como causa de muerte.</p><p></p><p><strong>El orden de los temas tratados en el texto es</strong></p>',40,'seleccionMultiple',20,1,1,1,'2022-05-23 22:26:09','2022-05-23 23:57:55'),(579,'Primera pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>Si lo que busca es aventurarse dentro de flora y fauna exótica en lugares donde pueda admirarse de las maravillas de la naturaleza, la Reserva de Producción Faunística Cuyabeno debe estar en su agenda de destinos.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:15','2022-05-24 01:42:34'),(580,'Segunda pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>Cuyabeno, ubicada en la provincia de Sucumbíos, noreste de la Región Amazónica de Ecuador, en este lugar que comprende un área es de 590.112 hectáreas, habitan más de 550 especies diferentes de aves, 60 especies de orquídeas, más de 350 especies de peces, 10 especies de monos, una gran variedad de reptiles como anacondas, caimanes y tortugas de río. Asimismo, aquí habitan 12.000 especies de plantas descubiertas dentro de la reserva, las cuales conviven con especies de mamíferos como el tapir (Tapirus terrestrís).</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:15','2022-05-24 01:46:18'),(581,'Tercera pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>El Cuyabeno es, además, el hogar de especies raras como el mítico delfín rosado de rio, el hoatzin o águila de la región, el cual mide hasta 66 centímetros de estatura y la apertura de sus alas alcanza hasta los 243 cm de extensión.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:16','2022-05-24 01:51:25'),(582,'Cuarta pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>La variedad de especies que posee este sistema lacustre compuesto por 13 lagunas, ríos y un bosque tropical inundado y otro semiinundado, hacen que Cuyabeno marque un récord, por los más altos niveles de biodiversidad que registra en comparación al mundo, junto al Parque Nacional Yasuní.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:16','2022-05-24 01:54:36'),(583,'Quinta pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>El Cuyabeno posee dos estaciones climáticas en el año. La época de lluvia, entre marzo y agosto; y la temporada seca, entre septiembre y febrero. En esta última existen lluvias esporádicas, debido a que se trata de un bosque lluvioso tropical.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:16','2022-05-24 01:57:14'),(584,'Sexta pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>Durante la temporada de lluvias, miles de hectáreas de bosque nativo se inundan formando El Dorado, con un número estimado de 350 especies de peces, dos especies de caimanes, boas y anacondas, y un sinnúmero de ranas y sapos que cantan sus conciertos interminables. Los delfines rosados han sido vistos nadando en los bosques inundados, ya que siguen a los peces.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:16','2022-05-24 02:00:54'),(585,'Séptima pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>El Cuyabeno fue decretada como reserva en 1979, bajo el contexto de la creación de un sistema de áreas naturales protegidas en el Ecuador, con base en un estudio de la FAO de 1976. Inicialmente tenía una dimensión de 155.000 ha.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:16','2022-05-24 02:03:07'),(586,'Octava pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>Llegar a la reserva de Cuyabeno no es fácil, debido a que pertenece al Sistema Nacional de Áreas Protegidas y muy pocos operadores de turismo están calificados para trabajar en esta zona.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:17','2022-05-24 02:06:39'),(587,'Novena pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>Si desea acceder por tierra a la reserva del Cuyabeno, debe tomar la ruta Lago Agrio - Tarapoa - Tipishca, en la Amazonia, para luego dirigirse hacia el puente del río Cuyabeno e iniciar un viaje de más de dos horas hacia las lagunas del Cuyabeno.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:17','2022-05-24 02:09:04'),(588,'Décima pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>En el Cuyabeno, selva adentro, usted puede acceder a varias comunidades indígenas que conservan aún sus tradiciones ancestrales, entre ellas, la ingesta de la bebida ayahuasca, un ritual que a decir de los shamanes, permite llegar a un estado en el cual la persona llega a tener visiones, emociones diversas y procesos de catarsis, sobre un problema que lo esté aquejando.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:18','2022-05-24 02:12:38'),(589,'Undécima pregunta',NULL,'<h6><strong>Identifique la idea principal en el siguiente fragmento de texto</strong></h6><p>El costo del viaje a la reserva del Cuyabeno depende del tour que decida elegir, pero su precio promedio va desde los $310 dólares en adelante, por persona. Si se anima a viajar a este destino, lo recomendable es llevar ropa con manga larga y pantalones largos y, sobre todo, disfrutar de desconectarse del ruido de la ciudad y maravillarse con los paisajes que se dibujan en los amaneceres y atardeceres”.</p>',41,'seleccionMultiple',8,1,1,0,'2022-05-23 22:26:18','2022-05-24 02:15:07'),(590,'Duodécima pregunta',NULL,'<h6><strong>Identifica el objetivo del siguiente texto</strong></h6><p>Las redes sociales son un fenómeno que cada vez gana m