hol en exceso no son alcohólicas ni tienen dependencia al alcohol.</p><p></p><h6><strong>El orden de la información tratada en el primer párrafo del texto sería</strong></h6>',41,'seleccionMultiple',12,1,0,0,'2022-05-23 22:26:18','2022-05-23 22:26:18'),(594,'Decimosexta pregunta',NULL,'<p></p><p>Un estudio realizado en junio pasado por el Centro de Investigación de Salud y Violencia (Cisalva) de la Universidad del Valle, estableció que solo el 1,7 por ciento de los motociclistas incluidos en un muestreo por las principales calles de la ciudad llevaban el casco protector.</p><p>El alcalde Mauricio Guzmán calcula en cien mil el número de motocicletas que circulan por la ciudad, pero oficialmente, hasta diciembre pasado, estaban matriculadas en Cali 68.492. Sin embargo, como lo explican los investigadores, el número es mucho más alto si se tiene en cuenta que gran parte de estos son registrados y proceden de otros municipios vecinos.</p><p>La Alcaldía ha expresado su seguridad de que con el uso del casco se reducirán considerablemente las cifras de heridos y muertos como consecuencia de accidentes de tránsito. El año (1994) pasado fueron 646 muertos, de los cuales 215,2 correspondieron a motociclistas o sus acompañantes.</p><p>Pero uno de los puntos que más preocupación causa es el de los costos sociales. Muerto o herido el individuo, se comprometen recursos económicos de la familia, su estabilidad emocional y laboral (hay que cuidar al enfermo), pérdida de empleo, etcétera.</p><p>El 40 por ciento de las muertes ocurridas en el período 1975-82 correspondieron a empleados y comerciantes en las edades comprendidas entre 20 y 40 años. Esto trae consigo grandes consecuencias económicas, ya que las personas afectadas se encuentran en el grupo de edad que se caracteriza por ser la población económicamente productiva, incrementando los años potenciales de vida perdidos .</p><p>Según el estudio de Cisalva, la gravedad de las lesiones producidas, especialmente el trauma craneoencefálico, representan el 30 por ciento de las intervenciones quirúrgicas realizadas.</p><p>Finalmente cita un estudio realizado en Cali en 1994, donde se encontró que en ninguno de los casos ni controles estudiados el afectado usaba casco y el trauma craneoencefálico se presentó en el 80 por ciento de los casos como causa de muerte.</p><p></p><p><strong>El orden de los temas tratados en el texto es</strong></p>',41,'seleccionMultiple',20,1,0,0,'2022-05-23 22:26:18','2022-05-23 22:26:18'),(595,'Primera pregunta',NULL,'<p>Analiza la siguiente situación y di si se presenta un caso de racismo</p><h6><strong>Daniela estudia con su mejor amiga María, una chica afrodescendiente. Ellas presentaron un examen en el que María sacó una mala nota, Daniela a modo de broma le dice \"ay amiga tú sí, te gusta coleccionar malas notas\".</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 00:38:54','2022-05-25 18:19:31'),(596,'Segunda Pregunta',NULL,'<h6>Analiza la siguiente situación y di si se presenta un caso de racismo</h6><h6><strong>Manolo llevó a su novia a casa de sus padres, ella es una chica afrodescendiente, la tía de Manolo la ve y dice, \"ay pues para ser negra es muy guapa la verdad, al principió me asusté pero te felicito, muy bonita\"</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 00:40:57','2022-05-25 18:21:13'),(597,'Tercera pregunta',NULL,'<h6>Analiza la siguiente situación y di si se presenta un caso de racismo</h6><h6><strong>Manolo llevó a su novia a casa de sus padres, ella es una chica afrodescendiente, el tío de Manolo la ve y dice, \"Eso sobrino, es que el que no ha salido con una negra no conoce el cielo\"</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 00:48:54','2022-05-25 18:23:42'),(598,'Cuarta pregunta',NULL,'<h6><strong>Manolo llevó a su novia a casa de sus padres, ella es una chica afrodescendiente, la mamá de Manolo la ve y dice, \"ay hijo, pues la verdad estoy contenta, creí que andarías soltero toda la vida y mira, conseguir una muchacha juiciosa y que está terminando su carrera\"</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 00:58:37','2022-05-25 18:25:16'),(599,'Quinta pregunta',NULL,'<h6><strong>Carolina es una chica afrodescendiente, trabaja en una empresa de correos, llegó un cliente y le dice \"mire señorita, estoy cansado de venir porque me notifican por correo que mi paquete ya llegó, pero vengo y es la quinta vez que me dice que el paquete no ha llegado, son unos ineficientes\"</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 01:01:13','2022-05-25 18:29:09'),(600,'Sexta pregunta',NULL,'<h6><strong>Miguel trabaja en una empresa de transporte, su jefe lo cambió de puesto a trabajar con otro compañero de trabajo, investigando la razón un amigo le contó \"Es que el jefe dice que tu raza es conflictiva, entonces que es mejor que no trabajes con Diego porque él es malgeniado y para evitar problemas te cambiaron\"</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 01:07:55','2022-05-25 18:31:32'),(601,'Séptima pregunta',NULL,'<h6><strong>Diego sale a una reunión con otros compañeros del trabajo y comenta \"Para mí que a Miguel lo cambiaron más bien por flojo, así con todos, o bueno la mayoría de los negritos, amigos para la rumba pero en el trabajo no tanto\" al decirle que esa afirmación es racista el dice \"Ole, pero ¿cómo me va a decir eso? si yo y Miguel somos amiguísimos salimos de rumba cada fincho, yo con los negros soy super amigo, otra cosa es que en el trabajo ellos no lo hagan bien, pero eso no quiere decir que no sea amigos de ellos y no me caigan bien todos\"</strong></h6>',42,'seleccionMultiple',10,1,1,1,'2022-05-25 01:15:24','2022-06-01 18:26:26'),(602,'Octava pregunta',NULL,'<h6><strong>Raúl estaba indeciso de invitar a salir a Samanta o a Julieta, decidió invitar a Julieta, ya que como es negra y van a rumbear con música champeta ella ha de bailar mejor porque es negra. Julieta a la final le dijo que no sabía bailar, por lo que Raúl ofendido le comenta a sus amigos \"meras excusas para no salir conmigo, cómo así que negra y no saber bailar champeta, eso no me lo creo, ha de tener a otro man o varios, esas mujeres son tremendas\"</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 01:18:57','2022-06-01 18:31:17'),(603,'Novena Pregunta',NULL,'<p><strong>Camila tiene una una amiga afrodescendiente ella se encuentra preocupada porque ella no ha regresado a casa, ya que hoy tenía que hacer algunas diligencias en un barrio peligroso.</strong></p>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 04:28:32','2022-06-01 18:33:35'),(604,'Décima pregunta',NULL,'<h6><strong>Carolina tiene un amigo afrodescendiente, sin embargo no ha querido presentarlo a su familia porque le avergüenza que sepan que es amiga de alguien de color.</strong></h6>',42,'seleccionMultiple',10,1,1,0,'2022-05-25 05:57:03','2022-06-01 18:34:40'),(605,'Primera pregunta','fotografias/1653600228.jpg','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',43,'seleccionMultiple',8,1,1,0,'2022-05-27 02:23:48','2022-05-27 23:20:06'),(606,'Segunda pregunta','fotografias/1653600333.jpg','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',43,'seleccionMultiple',8,1,1,0,'2022-05-27 02:25:33','2022-05-27 23:21:58'),(607,'Tercera pregunta','fotografias/1653600380.jpg','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',43,'seleccionMultiple',8,1,1,0,'2022-05-27 02:26:20','2022-05-27 23:23:44'),(608,'Cuarta pregunta','fotografias/1653600421.png','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',43,'seleccionMultiple',8,1,1,0,'2022-05-27 02:27:01','2022-05-27 23:26:02'),(609,'Quinta pregunta','fotografias/1653600479.png','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',43,'seleccionMultiple',8,1,1,0,'2022-05-