pregunta','fotografias/1653601555.png','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',48,'seleccionMultiple',8,1,0,0,'2022-06-06 04:20:56','2022-06-06 04:20:56'),(724,'Vigésima pregunta','fotografias/1653601644.jpg','<h6><strong>Identifica si el signo presentado es un icono, un símbolo o un indicio</strong></h6>',48,'seleccionMultiple',8,1,0,0,'2022-06-06 04:20:56','2022-06-06 04:20:56'),(725,'Primera pregunta',NULL,'<p>Analiza la siguiente situación y di si se presenta un caso de racismo</p><h6><strong>Daniela estudia con su mejor amiga María, una chica afrodescendiente. Ellas presentaron un examen en el que María sacó una mala nota, Daniela a modo de broma le dice \"ay amiga tú sí, te gusta coleccionar malas notas\".</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:06','2022-06-06 17:05:56'),(726,'Segunda Pregunta',NULL,'<h6>Analiza la siguiente situación y di si se presenta un caso de racismo</h6><h6><strong>Manolo llevó a su novia a casa de sus padres, ella es una chica afrodescendiente, la tía de Manolo la ve y dice, \"ay pues para ser negra es muy guapa la verdad, al principió me asusté pero te felicito, muy bonita\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:08:30'),(727,'Tercera pregunta',NULL,'<h6>Analiza la siguiente situación y di si se presenta un caso de racismo</h6><h6><strong>Manolo llevó a su novia a casa de sus padres, ella es una chica afrodescendiente, el tío de Manolo la ve y dice, \"Eso sobrino, es que el que no ha salido con una negra no conoce el cielo\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:10:54'),(728,'Cuarta pregunta',NULL,'<h6><strong>Manolo llevó a su novia a casa de sus padres, ella es una chica afrodescendiente, la mamá de Manolo la ve y dice, \"ay hijo, pues la verdad estoy contenta, creí que andarías soltero toda la vida y mira, conseguir una muchacha juiciosa y que está terminando su carrera\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:12:29'),(729,'Quinta pregunta',NULL,'<h6><strong>Carolina es una chica afrodescendiente, trabaja en una empresa de correos, llegó un cliente y le dice \"mire señorita, estoy cansado de venir porque me notifican por correo que mi paquete ya llegó, pero vengo y es la quinta vez que me dice que el paquete no ha llegado, son unos ineficientes\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:14:42'),(730,'Sexta pregunta',NULL,'<h6><strong>Miguel trabaja en una empresa de transporte, su jefe lo cambió de puesto a trabajar con otro compañero de trabajo, investigando la razón un amigo le contó \"Es que el jefe dice que tu raza es conflictiva, entonces que es mejor que no trabajes con Diego porque él es malgeniado y para evitar problemas te cambiaron\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:16:29'),(731,'Séptima pregunta',NULL,'<h6><strong>Diego sale a una reunión con otros compañeros del trabajo y comenta \"Para mí que a Miguel lo cambiaron más bien por flojo, así con todos, o bueno la mayoría de los negritos, amigos para la rumba pero en el trabajo no tanto\" al decirle que esa afirmación es racista el dice \"Ole, pero ¿cómo me va a decir eso? si yo y Miguel somos amiguísimos salimos de rumba cada fincho, yo con los negros soy super amigo, otra cosa es que en el trabajo ellos no lo hagan bien, pero eso no quiere decir que no sea amigos de ellos y no me caigan bien todos\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:18:26'),(732,'Octava pregunta',NULL,'<h6><strong>Raúl estaba indeciso de invitar a salir a Samanta o a Julieta, decidió invitar a Julieta, ya que como es negra y van a rumbear con música champeta ella ha de bailar mejor porque es negra. Julieta a la final le dijo que no sabía bailar, por lo que Raúl ofendido le comenta a sus amigos \"meras excusas para no salir conmigo, cómo así que negra y no saber bailar champeta, eso no me lo creo, ha de tener a otro man o varios, esas mujeres son tremendas\"</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:20:43'),(733,'Novena Pregunta',NULL,'<p><strong>Camila tiene una una amiga afrodescendiente ella se encuentra preocupada porque ella no ha regresado a casa, ya que hoy tenía que hacer algunas diligencias en un barrio peligroso.</strong></p>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:22:03'),(734,'Décima pregunta',NULL,'<h6><strong>Carolina tiene un amigo afrodescendiente, sin embargo no ha querido presentarlo a su familia porque le avergüenza que sepan que es amiga de alguien de color.</strong></h6>',49,'seleccionMultiple',10,1,1,0,'2022-06-06 04:36:07','2022-06-06 17:23:36'),(735,'Primera Pregunta',NULL,'<p>Según la tabla <strong>SEGA</strong></p><p></p><p>Las palabras esdrújulas se tildan cuando:</p>',50,'seleccionMultiple',5,1,0,0,'2022-06-06 09:05:45','2022-06-06 09:05:45'),(736,'Segunda pregunta',NULL,'<p>Según la tabla <strong>SEGA</strong></p><p>Las palabras agudas se tildan cuando</p><p></p><p></p>',50,'seleccionMultiple',5,1,0,0,'2022-06-06 09:05:45','2022-06-06 09:05:45'),(737,'Tercera pregunta',NULL,'<p>La palabra <strong>menu</strong></p><p>lleva tilde en:</p>',50,'seleccionMultiple',8,1,0,0,'2022-06-06 09:05:45','2022-06-06 09:05:45'),(738,'Cuarta pregunta',NULL,'<p>¿La palabra <strong>Papel </strong>lleva tilde?</p>',50,'seleccionMultiple',8,1,0,0,'2022-06-06 09:05:45','2022-06-06 09:05:45'),(739,'Quinta pregunta',NULL,'<p>¿Cuál es la forma correcta de escribir esta palabra?</p>',50,'seleccionMultiple',8,1,0,0,'2022-06-06 09:05:45','2022-06-06 09:05:45'),(740,'Sexta Pregunta',NULL,'<p>Una de las siguientes palabras está mal escrita:</p>',50,'seleccionMultiple',8,1,0,0,'2022-06-06 09:05:45','2022-06-06 09:05:45'),(741,'Séptima pregunta',NULL,'<p>Una de las siguientes palabra tiene mal la tilde<