bsp;</p><p>todas las pasaderas vanse con la edad,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>salvo amor de Dios, todas son liviandad.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>',58,'seleccionMultiple',8,1,0,0,'2022-07-18 02:15:29','2022-07-18 02:15:29'),(868,'Primera pregunta',NULL,'<h6><strong>Una comunidad se encuentra afectada por la ola invernal, muchos cultivos han sido arrasados, el gobernador llega a la comunidad y realiza una gestión de apoyo para solventar la crisis, además pide a los campesinos que fueron ayudados que se tomen una foto con él para publicar el proyecto en redes sociales y mejorar su imagen para la campaña.</strong></h6>',59,'seleccionMultiple',7,1,1,0,'2022-07-18 02:34:57','2022-07-18 18:42:57'),(869,'Segunda pregunta','fotografias/1655082147.png','<h6><strong>Analiza la actitud de Susanita [La niña rubia]</strong></h6>',59,'seleccionMultiple',7,1,1,1,'2022-07-18 02:34:57','2022-07-18 18:42:02'),(870,'Tercera pregunta','fotografias/1655082351.png','<h6><strong>Analiza la actitud de Mafalda [La niña]</strong></h6>',59,'seleccionMultiple',7,1,1,0,'2022-07-18 02:34:57','2022-07-18 18:44:49'),(871,'Cuarta pregunta',NULL,'<h6><strong>Daniela observa cómo un grupo de muchachos golpea a Alejandro, el chico nuevo, así que corre a cubrirlo pero uno de los chicos la golpeó por error.</strong></h6><p><strong>Analiza la actitud de Daniela</strong></p>',59,'seleccionMultiple',7,1,1,0,'2022-07-18 02:34:57','2022-07-18 18:46:27'),(872,'Quinta pregunta','fotografias/1655083150.PNG','<h6><strong>Analiza la actitud de Susanita</strong></h6>',59,'seleccionMultiple',8,1,1,0,'2022-07-18 02:34:57','2022-07-18 18:48:21'),(873,'Sexta pregunta','fotografias/1655084112.png','<h6><strong>Analiza la actitud de Guille [El bebé]</strong></h6>',59,'seleccionMultiple',7,1,1,0,'2022-07-18 02:34:57','2022-07-18 18:49:40'),(874,'Séptima pregunta','fotografias/1655084226.jpg','<h6><strong>An