-08-06 00:31:30','2022-08-06 03:38:10'),(907,'Decimoquinta Pregunta','fotografias/1659222611.jpg','<p>La Gallina Ciega es un cuadro de Goya, en el que se retrata la vida campestre, se observa en él a unos jóvenes disfrutando del tradicional juego de la gallina ciega.</p><p></p><p>Las características de esta obra son un reflejo del:</p>',61,'seleccionMultiple',10,1,1,0,'2022-08-06 00:31:30','2022-08-06 03:40:51'),(908,'Primera Pregunta',NULL,'<h6><strong>La parte subrayada es</strong></h6><p>Mas no de esotra parte en la ribera<br><u>Dejará la memoria, en donde ardía:<br></u>Nadar sabe mi llama el agua fría,<br>Y perder el respeto a ley severa.</p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:04:50'),(909,'Segunda Pregunta',NULL,'<h6><u>Alma, a quien todo un Dios prisión ha sido,<br>Venas, que humor a tanto fuego han dado,<br>Médulas, que han gloriosamente ardido,</u></h6><p>Su cuerpo dejará, no su cuidado;<br>Serán ceniza, mas tendrá sentido;<br>Polvo serán, mas polvo enamorado.</p><p></p><p><strong>La parte subrayada es</strong></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:06:54'),(910,'Tercera Pregunta',NULL,'<h6>Ir y quedarse, y con quedar partirse,<br>partir sin alma, y ir con alma ajena,<br>oír la dulce voz de una sirena<br>y no poder del árbol desasirse;</h6><p></p><p><strong>El tipo de rima según su disposición en esta estrofa es</strong></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:08:48'),(911,'Cuarta Pregunta',NULL,'<h6>Ir y quedarse, y con quedar part<u>irse,</u><br>partir sin alma, y ir con alma aj<u>ena,</u><br>oír la dulce voz de una sir<u>ena</u><br>y no poder del árbol desas<u>irse;</u></h6><p></p><p><strong>Según su timbre la rima es</strong></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:10:51'),(912,'Quinta Pregunta',NULL,'<h6><strong>Los versos de esta estrofa según su métrica son de tipo</strong></h6><p>En un verde prado <br>de rosas e flores <br>guardando ganado <br>con otros pastores</p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:13:53'),(913,'Sexta Pregunta',NULL,'<h6><strong>La sección subrayada es</strong></h6><p>Hombres necios que acusáis</p><p>a la mujer sin razón</p><p><u>sin ver que sois la ocasión</u></p><p>de lo mismo que culpáis:</p><p></p><p>si con ansia sin igual</p><p>solicitáis su desdén</p><p>¿por qué queréis que obren bien</p><p>si las incitáis al mal?</p><p></p><p></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:15:43'),(914,'Séptima Pregunta',NULL,'<h6><strong>La sección subrayada es</strong></h6><p>Hombres necios que acusáis<br>a la mujer sin razón<br>sin ver que sois la ocasión<br>de lo mismo que culpáis:</p><p><u>si con ansia sin igual<br>solicitáis su desdén<br>¿por qué queréis que obren bien<br>si las incitáis al mal?</u></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:17:15'),(915,'Octava Pregunta',NULL,'<h6><strong>Según su métrica los versos subrayos son de qué tipo</strong></h6><p></p><p><u>Hombres necios que acusáis</u><br>a la mujer sin razón<br><u>sin ver que sois la ocasión</u><br>de lo mismo que culpáis:</p><p></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:19:37'),(916,'Novena Pregunta',NULL,'<h6><strong>Según su disposición identifique el tipo de rima</strong></h6><p>Hombres necios que acusáis<br>a la mujer sin razón<br>sin ver que sois la ocasión<br>de lo mismo que culpáis:</p><p></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:21:44'),(917,'Décima Pregunta',NULL,'<h6><strong>Según su timbre identifique la rima en los siguientes versos</strong></h6><p>Vete a mirar los mineros, los hombres en el <strong>trigal</strong>,</p><p>y cántale a los que luchan, por un pedazo de <strong>pan</strong><br><br></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:23:29'),(918,'Undécima Pregunta',NULL,'<h6><strong>Identifique la rima Según su timbre</strong></h6><p>Un diablo se cayó al <strong>agua</strong></p><p>y otro diablo lo <strong>sacó</strong>,</p><p>y otro diablo que <strong>pasaba</strong></p><p>dijo: ‘¿Qué diablos <strong>pasó</strong>?’”.<br><br></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:25:10'),(919,'Duodécima Pregunta',NULL,'<h6><strong>En la sección subrayado identifique la rima según el timbre</strong></h6><p>Canta pájaro amante en la enra<strong>mada<br></strong>selva a su amor, que por el verde suelo<u><br></u>no ha visto al cazador que con desvelo<u><br></u>le está escuchando, la ballesta ar<strong>mada.</strong><br><br><br></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:27:03'),(920,'Decimotercera Pregunta',NULL,'<h6><strong>Identifica la rima según su disposición</strong></h6><p>Juventud divino tes<strong><u>oro</u></strong>,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>¡ya te vas para no volv<strong><u>er</u></strong>!&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>Cuando quiero llorar no ll<strong><u>oro</u></strong>…&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>y a veces lloro sin quer<strong><u>er</u></strong>.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><br></p>',62,'seleccionMultiple',8,1,1,0,'2022-08-09 19:26:43','2022-08-09 21:28:35'),(921,'Decimocuarta Pregunta',NULL,'<h6><strong>Identifique la rima según su disposición</strong></h6><p>Como dice Salamo y dice la verdad:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>que las cosas del mundo todas son vanidad,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>todas las pasaderas vanse con la edad,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>salvo amor de Dios, todas son liviandad.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>',62,'seleccionMultiple',8,1,1,1,'2022-08-09 19:26:43','2022-08-09 21:29:34'),(922,'Primera Pregunta',NULL,'<h6><strong>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</strong></h6><p>Aquella noche ella despertó agitada, <u>rápidamente</u> se levantó y observó el armario a ver si había algo <u>allí</u></p>',63,'seleccionMultiple',8,1,0,0,'2022-08-10 19:30:04','2022-08-10 19:30:04'),(923,'Segunda Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p></p><p>Con miedo se acercó al armario, <u>despacio</u> abrió la puerta, <u>mientras</u> que en la otra mano sostenía su lampara de noche</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-10 19:41:36','2022-08-10 19:41:36'),(924,'Tercera Pregunta',NULL,'<p>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</p><p>Abrió, sin embargo, no había <u>nada</u>, se alejó e intentó calmarse, <u>casi</u> había amanecido. &nbsp;</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:37:19','2022-08-15 21:37:19'),(925,'Cuarta Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p><u>Temprano</u> en la mañana, se dispuso a prepararse para el trabajo, aunque <u>después</u> de ese susto no pudo dormir.</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:37:49','2022-08-15 21:37:49'),(926,'Quinta Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Al medio día se sintió <u>mejor</u>, ya el susto había pasado pero <u>aún</u> pensaba en ello.</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:38:17','2022-08-18 05:34:17'),(927,'Sexta Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Tranquila,  sintiéndose segura con la luz del sol decidió revisar el armario de nuevo, fue <u>arriba</u> a su habitación y <u>aprisa</u></p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:38:43','2022-08-18 05:33:48'),(928,'Séptima Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Revisó <u>minuciosamente</u> el armario, primero por fuera, no encontró <u>nada</u></p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:44:41','2022-08-15 21:44:41'),(929,'Octava Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Abrió entonces la puerta,  a primera vista pareciera que no había algo fuera de lugar, <u>casi</u> deja de revisar si no es por un leve brillo que vio en una de las esquinas, se acercó un poco <u>más</u> para inspeccionar mejor</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:45:35','2022-08-18 05:32:58'),(930,'Novena Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Primero pensó que era algún reflejo, pero <u>pronto</u> se dio cuenta que ese resplandor no podía provenir de ninguna luz de la habitación, acercó su mano <u>cuidadosamente</u> y tocó aquella esquina</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:46:21','2022-08-15 21:46:21'),(931,'Décima Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Sintió de repente un estremecimiento en <u>todo</u> su cuerpo, un frío empezó a invadirla y visiones horribles pasaron por su mente, <u>rápidamente</u> se alejó</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:48:23','2022-08-15 21:48:23'),(932,'Undécima Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Asustada fue corriendo al sótano, ni siquiera prendió la luz, <u>después</u> del terror sentido sólo pensaba en deshacerse de ese armario, sacó su hacha y corrió de nuevo <u>arriba</u>, a su cuarto.</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:48:56','2022-08-15 21:48:56'),(933,'Duodécima Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Con un terror histérico empezó a romper el armario con el hacha, el sonido de la madera al romperse invadió <u>toda</u> la habitación, quedaron solo esquirlas, las que recogió cuidadosamente para <u>luego</u> quemarlas</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:49:50','2022-08-15 21:49:50'),(934,'Decimotercera Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Lo que restó de la tarde se sintió inquieta, pero al ver que <u>solo</u> quedaban cenizas de aquel maldito armario se sintió <u>más</u> tranquila</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:50:25','2022-08-15 21:50:25'),(935,'Decimocuarta Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Ya calmada se preparó para dormir, sin embargo, prefirió quedarse en la sala, <u>allí</u> se sentía <u>más</u> segura</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:51:08','2022-08-15 21:51:08'),(936,'Decimoquinta Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p><u>Luego</u>, durante la noche, algo la despertó,  la agitación y los nervios regresaron, desde donde estaba lograba escuchar los ruidos que provenían de <u>arriba</u>, de su habitación.</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:52:20','2022-08-18 05:30:10'),(937,'Decimosexta Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Pensó en llamar a alguien y pedir ayuda, pero al intentar llamar <u>solo</u> escuchaba ruido de estática y <u>nada</u> más.</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:53:41','2022-08-15 21:53:41'),(938,'Decimoséptima Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Los recuerdos de aquellas visiones la atormentaron, <u>solo</u> oscuridad y apenas visibles rostros pálidos, alargados, gritos y lamentos, manos de largos dedos acercándose a ella cada vez <u>más</u> y más</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:54:28','2022-08-15 21:54:28'),(939,'Decimoctava Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Decidió no pensar más en lo que vio al tocar aquello en el armario, pero seguía escuchando los ruidos <u>arriba</u>, era como si alguien lanzara una roca contra las paredes, rebotando aquí y <u>allá</u></p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:55:39','2022-08-15 21:55:39'),(940,'Decimonovena Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Tal vez, era <u>solo</u> su imaginación, quizás en su miedo olvidó cerrar la ventana y algo <u>allí</u> se movía por el viento.</p>',63,'seleccionMultiple',8,1,0,0,'2022-08-15 21:56:13','2022-08-15 21:56:13'),(941,'Vigésima Pregunta',NULL,'<h6>Analice la siguiente frase, observe las palabras subrayadas e identifique el tipo de adverbio, al que corresponden.</h6><p>Intentó calmarse pensando en eso, en que eran cosas normales, que <u>nada</u> tenían que ver