,'Novena Pregunta',NULL,'<h6>Si se quiere graduar la realización de la tesis es algo <u>ineludible</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 02:57:37','2022-09-05 02:57:37'),(1135,'Décima Pregunta',NULL,'<h6>Por favor borren esa foto, ya que la tomaron <u>sin</u> <u>consentimiento</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:01:58','2022-09-05 03:01:58'),(1136,'Undécima Pregunta',NULL,'<h6>Ella tiene <u>descendencia</u> negra</h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:04:06','2022-09-05 03:04:06'),(1137,'Duodécima Pregunta',NULL,'<h6>Todos van a salir <u>excepto</u> Rigoberto</h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:14:13','2022-09-05 03:14:13'),(1138,'Decimotercera Pregunta',NULL,'<h6>Ninguno de ustedes ha realizado la actividad, <u>es preciso</u> que lo entreguen</h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:15:32','2022-09-05 03:15:32'),(1139,'Decimocuarta Pregunta',NULL,'<h6>Realmente este fue un proyecto <u>infructuoso</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:18:00','2022-09-05 03:18:00'),(1140,'Decimoquinta Pregunta',NULL,'<h6>Perdiste las llaves del Ferrari de tu jefe, estás en un gran <u>apuro</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:20:08','2022-09-05 03:20:08'),(1141,'Decimosexta Pregunta',NULL,'<h6>El devolvió el dinero, pero quedó enojado, creyó que habría <u>retribución</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:21:56','2022-09-05 03:21:56'),(1142,'Decimoséptima Pregunta',NULL,'<h6>Ella es pelirroja, tiene <u>ascendencia</u> europea</h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:25:56','2022-09-05 03:25:56'),(1143,'Decimoctava Pregunta',NULL,'<h6>Deberíamos reconsiderar su propuesta, podría ser un negocio <u>fructífero</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:27:33','2022-09-05 03:27:33'),(1144,'Decimonovena Pregunta',NULL,'<h6>Creo que realmente necesitamos <u>deliberar</u> acerca del asunto&nbsp;</h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:29:36','2022-09-05 03:29:36'),(1145,'Vigésima Pregunta',NULL,'<h6>La gente se vestía mejor en <u>antaño</u></h6>',74,'seleccionMultiple',5,1,0,0,'2022-09-05 03:30:47','2022-09-05 03:30:47');
